I know it’s taken me ages but finally taking you through the second half of my June/July Empties.

It’s been a strong few months and a lot on my ‘would repurchase’ list let’s get cracking. 

In less than 3 minutes I’ll take you through the headlines and some of my thoughts on the following products:
@philip_kingsley Tricho Pro Volumizing Protein Spray. Super for post pregnancy or age related hair fall. Slows excessive hair loss for me. 
@herbalfacefood Review on my grid. 
@sundayrileyeurope CEO Glow. My favourite Vit C. Smells beautiful, had a brilliant brightening effect and lasts ages. 
@beautypie Uber Youth Eye Energy Peptide Infusion Cream. Lovely hydrating eye cream and great for mature skin. Only good value as a member. If not, there are other more effective creams out there. 

