My biggest tick? Me. On Instagram.

Calling myself a “content creator” (ick), using Gen Z phrases like “delulu” as if I wasn’t born in the 80s, and doing my best impression of a Love Island contestant being pulled for a chat while trying to show off a serum. It’s a talent. Just not a cool one.

Anyway, please like and share my latest Reel. She’s fire 😬

